window.bookSummaryJSON = "<p>The flames of war spread through the Cursed Princedom to devastating effect. Bound by powerful centuries-old magic, the Great Essences yearn to regain their freedom. In the face of an impossible mission, Krian has no choice but to keep going while risking everything that's become dear to him. The only solution is to become stronger and forget the meaning of the word <i>impossible</i>. And so a plangent wolf's howl soars over the battlefield as a plate-clad cavalry rushes the enemy ranks.... </p>"; 
